/* eslint-disable react/prop-types */
import React from 'react';
import { ImageBackground, Text, View } from 'react-native';
import { connect } from 'react-redux';
import NavigationBar from '../NavigationBar/NavigationBar';
import styles from './SearchListStyles';
import absalomBacground from '../../images/absalom-background.png';

function SearchList({
  characterItem, userItem, dispatch, navigation,
}) {
  return (
    <ImageBackground style={styles.backgroundImage} source={absalomBacground}>
      <View>
        <Text>SearchList</Text>
      </View>
      <NavigationBar navigation={navigation} />
    </ImageBackground>
  );
}

SearchList.defaultProps = {
  characterItem: {},
  userItem: {},
};

function mapStateToProps({ charactersReducer, usersReducer }) {
  return {
    characterItem: charactersReducer.characterItem,
    userItem: usersReducer.userItem,
  };
}

export default connect(mapStateToProps)(SearchList);
